import AboutPage from "../../pages/aboutpage/AboutPage";
import HomePage from "../../pages/homepage/HomePage";
import MenuItem from "./MenuItem";

function Menu(props) {
    
    return(
        <div id="menu">
            <ul>
                <MenuItem page={<HomePage />} menuDegistir={props.menuSayfaDegistirici} text="Anasayfa" href="#homePage" />
                <MenuItem page={<AboutPage />} menuDegistir={props.menuSayfaDegistirici} text="Hakkımda" href="#aboutPage"  />
                <MenuItem menuDegistir={props.menuSayfaDegistirici} text="Portfolyo" href=""  />
                <MenuItem menuDegistir={props.menuSayfaDegistirici} text="İletişim" href=""  />
            </ul>
        </div>
    );
}
export default Menu;
